				 value = PFvalue},
		    #'LabelPair'{name = NFname, value = NFvalue}, _) ->
    #'LabelPair'{name =
		     if NFname =:= undefined -> PFname;
			true -> NFname
		     end,
		 value =
		     if NFvalue =:= undefined -> PFvalue;
			true -> NFvalue
		     end}.

