		   if PFquantile /= undefined, NFquantile /= undefined ->
			  'erlang_++'(PFquantile, NFquantile, TrUserData);
		      PFquantile == undefined -> NFquantile;
		      NFquantile == undefined -> PFquantile
		   end}.

